	@Test
	public void checkIfIiif() {
		boolean isIiif1 = IiifChecker.checkIfIiif(europeanaRestResponseIiif, Aggregator.EUROPEANA);
		boolean isIiif2 = IiifChecker.checkIfIiif(europeanaRestResponseNoIiif, Aggregator.EUROPEANA);
		boolean isIiif3 = IiifChecker.checkIfIiif(europeanaRestResponseNoIiifWrongMimeType, Aggregator.EUROPEANA);
		boolean isIiif4 = IiifChecker.checkIfIiif(europeanaRestResponseNoIiifNoMimeType, Aggregator.EUROPEANA);
		boolean isIiif5 = IiifChecker.checkIfIiif(ddbRestResponse, Aggregator.DDB);
		boolean isIiif6 = IiifChecker.checkIfIiif(europeanaRestResponse19141918, Aggregator.EUROPEANA);

		Assert.assertTrue(isIiif1);
		Assert.assertFalse(isIiif2);
		Assert.assertFalse(isIiif3);
		Assert.assertFalse(isIiif4);
		Assert.assertFalse(isIiif5);
		Assert.assertFalse(isIiif6);
	}

